export function initializeWorkers(scene) {
  initializeEnemySpawnerWorker(scene);
  initializeTimeWorker(scene);
  initializeEnemyCounterWorker(scene);
}

export function terminateWorkers(scene) {
  if (scene.worker) { 
    scene.worker.terminate();
    scene.worker = null;
  }

  if (scene.timeWorker) {
    scene.timeWorker.terminate();
    scene.timeWorker = null;
  }

  if (scene.enemyWorker) {
    scene.enemyWorker.terminate();
    scene.enemyWorker = null;
  }
}

function initializeEnemySpawnerWorker(scene) {
  if (scene.worker) return;
  scene.worker = new Worker('../../utils/Workers/enemySpawnerWorker.js');
  
  const mapWidth = 1600;
  const mapHeight = 800;
  const interval = 3000;
  
  scene.worker.postMessage({ mapWidth, mapHeight, interval });
  
  scene.worker.onmessage = (e) => {
    if (!scene.isGameOver && scene.enemies) {
      const { x, y } = e.data;
      console.log(`Nuevo enemigo generado en posicin (${x}, ${y})`);
      const randomType = Math.random() < 0.5 ? 'enemy' : 'shootingEnemy';

      if (randomType === 'enemy' && scene.enemies.getChildren().length < 50) {
        scene.enemies.add(new Enemy(scene, x, y));
      } else if (randomType === 'shootingEnemy' && scene.shootingEnemies.getChildren().length < 20) {
        scene.shootingEnemies.add(new ShootingEnemy(scene, x, y));
      }
    }
  };
}

function initializeTimeWorker(scene) {
  if (scene.timeWorker) return;
  scene.timeWorker = new Worker('../../utils/Workers/timeCounterWorker.js');

  scene.timeWorker.postMessage({});
  
  scene.timeWorker.onmessage = (e) => {
    scene.timeRemaining = e.data;
    if (!scene.isGameOver && scene.survivalTimeText) {
      scene.survivalTimeText.setText(`Tiempo restante: ${scene.timeRemaining}s`);

      if (scene.timeRemaining <= 0) {
        if (scene.enemiesDefeated < 10) {
          scene.handleGameOver();
        } else {
          scene.moveToBossFinal();
        }
      }
    }
  };
}

function initializeEnemyCounterWorker(scene) {
  if (scene.enemyWorker) return;
  scene.enemyWorker = new Worker('../../utils/Workers/enemyCounterWorker.js');

  scene.enemyWorker.onmessage = (e) => {
    scene.enemiesDefeated = e.data;
    scene.enemiesDefeatedText.setText(`Enemigos derrotados: ${scene.enemiesDefeated}`);
  };
}
